import React from 'react';
import s from './ProfileInfo.module.css';

const ProfileStatusWithHooks =(props) => {
 
        return (
            <div>
                {
                    <div>
                    <span onClick={ this.activateEditMode }>{props.status || '---'}</span> 
                    </div>
                }
                {false &&
                    <div>
                        <input onChange={this.onStatusChange} autoFocus={true}  value={''} />
                    </div>
                }
            </div>    
        )
   
}

export default ProfileStatusWithHooks;
